column8:
■マウスパッドに複数の突起が付いていてスマホや名刺を挟んで収納可能！<br>
マウスパットの上部に突起が複数付いているので、スマホ等々を挟んで収納できます。<br>
突起は一部が斜めにカットされているので物を挟んだ際に見やすい角度になります。<br>
<br>
■適度な柔軟性でものを傷つけにくい！目盛り付きでサイズも量れる！<br>
TPU素材を使用しており、適度な柔軟性でものをしっかりと挟み傷つけにくいです。<br>
マウスパッド左側に目盛りが刻まれており、ちょっとしたものを量りたい時に便利！<br>
<br>
材質：TPU<br>
サイズ(約)：27cm×20.5cm<br>
重量(約)：245g<br>
カラー：グレー、ライトグレー<br>
取扱説明書：なし<br>
製造国：中国<br>
<br>
